import AvatarWoman from '../../../assets/img/png/avatar-woman.png';

import './ReviewsCourses.scss';

export default function ReviewsCourses() {
    return (
        <Row className="review-courses">

            <Col lg={16} className="review-courses__title">
                ReviewsCourses
            </Col>
        </Row>
    )
}
